// –û–ø—Ä–µ–¥–µ–ª–µ–Ω–∏–µ –∫–ª–∞—Å—Å–∞ Specialist (–°–ø–µ—Ü–∏–∞–ª–∏—Å—Ç)
class Specialist {
    // –ó–∞—â–∏—â–µ–Ω–Ω—ã–µ –ø–æ–ª—è –¥–ª—è –∏–º–µ–Ω–∏ –∏ —Å–ø–µ—Ü–∏–∞–ª–∏–∑–∞—Ü–∏–∏
