    }

    // –ü–µ—Ä–µ–æ–ø—Ä–µ–¥–µ–ª–µ–Ω–∏–µ –º–µ—Ç–æ–¥–∞ toString –¥–ª—è –≤—ã–≤–æ–¥–∞ –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–∏ –æ —Å–ø–µ—Ü–∏–∞–ª–∏—Å—Ç–µ
    @Override
    public String toString() {
        return "–°–ø–µ—Ü–∏–∞–ª–∏—Å—Ç: " + getName() + ", –°–ø–µ—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è: " + getSpecialization();
    }
